import clsx from 'clsx';
import styles from './TableForm.module.scss'
import { useSelector } from 'react-redux';
import { getAllTables } from '../../redux/store';

const TableForm = () => {
  const table = useSelector(state => getAllTables(state));

  return (
    <div className="container">
      <div >
        <h3 className="mt-4 pt-4">Status:</h3>
        <select>
          <option value="Free">Free</option>
          <option value="Busy">Busy</option>
          <option value="Cleaning">Cleaning</option>
          <option value="Reserved">Reserved</option>
        </select>
      </div>

      <div>
        <h3 className="mt-4 pt-4">People:</h3>
        <input type="number"></input><span>/</span><input type="number"></input>
      </div>

      <div>
        <h3 className="mt-4 pt-4">Bill:</h3>
        <span>$</span><input type="number"></input>
      </div>

      <button className={clsx("btn-default btn-lg mt-4", styles.mybtn)}>Update</button>


    </div >
  )

}

export default TableForm;
